import gsap from 'gsap';

class MyComponent extends React.Component {
    constructor(props){
      super(props);
      // reference to the DOM node
      this.myElement = null;
      // reference to the animation
      this.myTween = null;
    }
  
    componentDidMount(){
      // use the node ref to create the animation
      this.myTween = gsap.to(this.myElement, {duration: 2, delay: 2, x: 100, y: 100,repeat,  yoyo: true});
    }
  
    render(){
        return( <React.Fragment>
            <div ref={div => this.myElement = div} />
            <style jsx>
                {
                    `
                    div {
                        width: 100px;
                        height: 100px;
                        background: red;
                        margin: 300px;
                    }
                    `
                }
            </style>
        </React.Fragment>)
      
    }
  }

  export default MyComponent;
